def main(filename):

	FPS = 100.0


	with open(filename, 'rb') as f:
		samples = pickle.load(f)


	x, y, z, speed, curvature = convolution_filter(samples, 1, FPS)

	x = x - np.mean(x)
	y = y - np.mean(y)

	# colored_line(x, y, z, linewidth = .0001)


	xy = zip(x, y)
	fft = np.fft.fft(xy)


	# Turning radius? (curvature)
	# Speed?

